def filterNifty50Symbols():
    blue_chips = set(getBlueChipsSymbos())
    nifty50 = set(getNifty50Symbols())
    filtered_symbols = list(nifty50 - blue_chips)
    return filtered_symbols

def getNifty500SymbolsExceptNifty50():
    nifty50 = set(getNifty50Symbols())
    nifty500 = set(getNifty500Symbols())
    filtered_symbols = list(nifty500 - nifty50)
    print(f"Total Nifty500 symbols: {len(filtered_symbols)}")
    return filtered_symbols

def getAllIntradayNSEApprovedSymbolsExceptNifty50():
    nifty50 = set(getNifty50Symbols())
    nse_intraday = set(getAllIntradayNSEApprovedSymbols())
    filtered_symbols = list(nse_intraday - nifty50 )
    print(f"Total NSE approved intraday symbols: {len(filtered_symbols)}")
    return filtered_symbols


def getAllIntradayNSEApprovedSymbolsExceptNifty500():
    nifty500 = set(getNifty500Symbols())
    nse_intraday = set(getAllIntradayNSEApprovedSymbols())
    filtered_symbols = list(nse_intraday - nifty500)
    print(f"Total NSE approved intraday symbols: {len(filtered_symbols)}")
    return filtered_symbols

